import { css } from "@emotion/react"

const Navigation = () => {
  const style = css`
    background-color: red;
  `

  return (
    <nav>
      <h2>Chitsino</h2>
      <ul>
        <li>Home</li>
        <li>Gamble</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
}

export default Navigation
